function SeuilHautBas(lxi,rgc,Icone){ //(lxi=i,rgc=rang de colonne de donénes dans la ligne 0 du menu,Icone)
xnul=1

if(menuIconeEchelle[Icone][3][2]!=-99999 & base00[lxi][menuIconeEchelle[Icone][3][2]]!=-99999){

if( menuIconeEchelle[Icone][3][3]!=-99999){if((base00[lxi][menuIconeEchelle[Icone][3][2]])<=menuIconeEchelle[Icone][3][3]){xnul=0}};if( menuIconeEchelle[Icone][3][4]!=-99999){if((base00[lxi][menuIconeEchelle[Icone][3][2]])>=menuIconeEchelle[Icone][3][4]){xnul=0}}
